import React from 'react'
import User from './User'

class App extends React.Component {
	constructor() {
		super();

		this.state = {
			name: 'Коля',
			surname: 'Иванов',
		};
	}

  handle() {
    alert(this.state.surname)
  }

	render() {
		return <div>
			<User
        name = {this.state.name}
        surname = {this.state.surname}
        handle = {this.handle.bind(this)}
      />
		</div>;
	}
}

export default App;
